
 /*Homework
A lo largo del módulo ustedes serán los analistas de datos de una compañía de venta de insumos tecnológicos al público. 
A lo largo de las prácticas se harán cargo de la información de la empresa y realizarán el proceso completo de captura, 
limpieza, análisis, diagnóstico, documentación, explotación y publicación de resultados.

La Dirección de Ventas ha solicitado las siguientes tablas a Marketing con el fin de que sean integradas:

La tabla de puntos de venta propios, un Excel frecuentemente utilizado para contactar a cada sucursal, actualizada en 2021.
La tabla de empleados, un Excel mantenido por el personal administrativo de RRHH.
La tabla de proveedores, un Excel mantenido por un analista de otra dirección que ya no esta en la empresa.
La tabla de clientes, alojada en el CRM de la empresa.
La tabla de productos, un Excel mantenido por otro analista.
Las tablas de ventas, gastos y compras, tres archivos CSV generados a partir del sistema transaccional de la empresa.
Es necesario realizar la captura de esos archivos e ingestarlos dentro de nuestra base de datos.*/

-- Crear base de datos
CREATE DATABASE IF NOT EXISTS henry_m3;

USE henry_m3;

-- Crear tablas 
CREATE TABLE IF NOT EXISTS sucursales (
sucursalID INT NOT NULL,
nombre VARCHAR(50),
direccion VARCHAR(50) NOT NULL,
localidad VARCHAR(50),
provincia VARCHAR(50),
latitud LONG, -- revisar este data type. -- preferible varchar por la coma o hacer replace mientras se hace el upload
longitud LONG)
-- PRIMARY KEY (sucursalID))
;

CREATE TABLE IF NOT EXISTS empleados (
empleadoID INT NOT NULL,
apellido VARCHAR(20),
nombre VARCHAR(20),
sucursal VARCHAR(50), -- revisar si esto se puede convertir in foreign key
sector VARCHAR(20),
cargo VARCHAR(20),
salario DECIMAL(10,2)) 
;

CREATE TABLE IF NOT EXISTS proveedores (
proveedorID INT NOT NULL,
nombre VARCHAR (50),
direccion VARCHAR(50),
ciudad VARCHAR(50),
estado VARCHAR(50),
pais VARCHAR(50),
departamento VARCHAR(50))
;

CREATE TABLE IF NOT EXISTS clientes (
clienteID INT NOT NULL,
provincia VARCHAR(75),
nombreApellido VARCHAR(75),
domicilio VARCHAR(125),
telefono VARCHAR(50), -- revisar este data type- OK
edad INT,
localidad VARCHAR(75),
X VARCHAR(30),
Y VARCHAR(30),
fechaAlta DATE,
usuarioAlta VARCHAR(50),
fechaUltMod DATE,
usuarioUltMod VARCHAR(50),
marcaBaja TINYINT,
col10 VARCHAR(5))
;

CREATE TABLE IF NOT EXISTS productos (
productoID INT NOT NULL,
concepto VARCHAR(75),
tipo VARCHAR(50),
precio LONG) -- > Tuve que ponerle lONG para que leyera los numeros bien con la coma como decimal, no hubo otra forma. TAMBIEN SE PUEDE SUBIR COMO VARCHAR
;

CREATE TABLE IF NOT EXISTS canalventas (
canalID INT NOT NULL,
descripcion VARCHAR(20))
;

CREATE TABLE IF NOT EXISTS ventas (
ventaID INT NOT NULL,
fecha DATE,
fechaEntrega DATE,
canalID INT NOT NULL,
clienteID INT NOT NULL,
sucursalID INT NOT NULL,
empleadoID INT NOT NULL,
productoID INT NOT NULL,
precio DECIMAL(10,2),
cantidad INT)
;

CREATE TABLE IF NOT EXISTS tipogasto (
tipoGastoID INT NOT NULL,
descripcion VARCHAR(50),
montoAprox DOUBLE)
;

CREATE TABLE IF NOT EXISTS gastos (
gastoID INT NOT NULL,
sucursalID INT,
tipoGastoID INT,
fecha DATE,
monto DOUBLE)
;

CREATE TABLE IF NOT EXISTS compras (
compraID INT NOT NULL,
fecha DATE,
productoID INT,
cantidad INT,
precio DOUBLE,
proveedorID INT)
;

